with open(model_file, 'rb') as f_in:
    model = pickle.load(f_in)

def get_result(individual, clf):
    # Store ethicities.
    ethnicities = {}
    n = len(individual)
    # Iterate.
    for t in range(0, n, 100):
        sub_snp = individual[t:t+100]
        # Classify.
        prediction = clf.predict([sub_snp])[0]
        # Add.
        if prediction not in ethnicities:
            ethnicities[prediction] = 1
        else:
            ethnicities[prediction] += 1

    # Determine ancestry.
    for ethnicity in ethnicities:
        ethnicities[ethnicity] = ethnicities[ethnicity]/(n//100)

    result = []

    for ethnicity, percentage in ethnicities.items():
        result.append([ethnicity, percentage])
    
    return result

